    const [floorPlanSectionVisible, setFloorPlanSectionVisible] = useState(false);
    const [selectedFloorNumber, setSelectedFloorNumber] = useState(0);

    const [flatSectionVisible, setFlatSectionVisible] = useState(false);
    const [selectedFlatNumber, setSelectedFlatNumber] = useState(0);

    const [selectedApartment, setSelectedApartment] = useState<Apartment | undefined>(undefined);

    const [filterVisible, setFilterVisible] = useState(true);
    const [filterMinimized, setFilterMinimized] = useState(true);
    const [apartmentsVisible, setApartmentsVisible] = useState(false);

    const [searchedApartments, setSearchedApartments] = useState<Apartment[]>([]);

    const [floorPlanSectionInitiated, setFloorPlanSectionInitiated] = useState<boolean>(false);
    const [apartmentsSectionInitiated, setApartmentsSectionInitiated] = useState<boolean>(false);

    const [previousFloor, setPreviousFloor] = useState<number>(-1);

    const {t} = useTranslation("global")

    function anyPopupVisible(): boolean {
        return floorPlanSectionVisible || flatSectionVisible || apartmentsVisible;
    }

    const handleLanguageChange = (lang: string) => {
        i18n.changeLanguage(lang.toLowerCase());
        localStorage.setItem("selectedLanguage", lang);
    }

    useEffect(() => {
        const item = localStorage.getItem("selectedLanguage");
        if (item !== undefined && item !== null) {
            handleLanguageChange(item)
        }
    }, [])

    function processCurrentFloorSelection(floorNumber: number) {
        setSelectedFloorNumber(floorNumber)
        setFloorPlanSectionVisible(true)
        setFilterVisible(false)
        setFloorPlanSectionInitiated(true)
        setApartmentsSectionInitiated(false)
    }

    function processCurrentFloorSelectionMobile(floorNumber: number) {
        if (previousFloor === floorNumber) {
            if(floorNumber === 12){
                setSelectedFloorNumber(floorNumber-1)
            } else {
                setSelectedFloorNumber(floorNumber);
            }
            setFloorPlanSectionVisible(true)
            setFilterVisible(false)
            setFloorPlanSectionInitiated(true)
            setApartmentsSectionInitiated(false)
            setPreviousFloor(-1)
        } else {
            setPreviousFloor(floorNumber)
        }
    }

